// atom.config.set('core.editor.multiCursorOnClick', true);

import React from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function UserProfile() {
  return (
    <Row id="userNameBody">
      <img id="mainLogo" src="logo.png" />
      <Col>
        <h1 className="userName">Dekempsy4</h1>
        <button id="settingsButton">
          <Row >
            <img id="settingPic" src = "settings.png" />
            <h2 className="settingTag">Settings</h2>
          </Row>
        </button>
       </Col>
    </Row>
  );
}




function PastGame() {
  return(
    <li className="historyItem">
      <button className="historyButton">
        <Row>
          <div className="coachTag">Coach:</div>
          <img src="logo.png" className="coachIcon" />
          <div className="coachUsername">Joe Biden</div>
        </Row>
        <Row>
          <div className="dateTag">6/19/20</div>
          <div className="durationTag">Length: 1 hour</div>
        </Row>
      </button>
    </li>
  );
}

function HistoryBar() {
  return (
      <Row id="historyContainer">
        <ul id="historyList">
          <PastGame />
          <PastGame />
          <PastGame />
          <PastGame />
          <PastGame />
          <PastGame />
          <PastGame />
        </ul>

        <button id="scheduleButton">
          <img src="shceduleButton.png" id="scheduleImg" width="100%" height="100%"/>
        </button>

      </Row>
  );
}

function BackButton() {
  return (
    <button id="backButton">
      <img src="backButton.png" id="backButtonImg" />
    </button>
  );
}

function ProfileSideBar() {
  return (
      <Container id="sideBar">
        <UserProfile />
        <HistoryBar />
        <BackButton />
      </Container>
  );
}

function GameDetails() {
  return(
    <Row>
      <h1 id="detailsHead">Game Details</h1>
      <div>Coach: Joe Biden</div>
      <div>Time: 3:45-4:45 (60 mins)</div>
    </Row>
  )
}



function DetailsBar() {
  return (
    <Container id="detailsBar" fluid="xs">
      <GameDetails />
      // <Recording />
      // <CoachNotes />
    </Container>
  );

}



function App() {

  return (
    <Container fluid="xs">
      <Row xs={12}>
        <Col xs={3}> <ProfileSideBar /> </Col>
        <Col xs={5}> <DetailsBar /> </Col>
      </Row>
    </Container>
  );
}

export default App;
